import React from "react";

function Scores() {
  return (
    <div className="flexScores">
      <div className="score">
        <p className="ScoreHead"></p>
        <p className="ScoreHead"></p>
      </div>
      <div className="HighScore">
        <p className="ScoreHead"></p>
        <p className="ScoreHead"></p>
      </div>
    </div>
  );
}

export default Scores;
